import React from 'react';
import ReactDOM from 'react-dom';

const Hello = (props) => {
  return (
    <div>
      <p>Greetings {props.name}</p>
    </div>
  )
}

const App = () => {
  const now = new Date()
  const a = 10
  const b = 20
  return (
  <div>
    <p>Hello World, it is {now.toString()}</p>
    <Hello />
  </div>
  )
}


ReactDOM.render(<App />, document.getElementById("root"))
